import React from 'react';
import Carousel from 'react-bootstrap/Carousel'




const Carousel$ = ({UserPhotos}) => {

    const controls = props.UserPhotos.length === 1 ? false : true ;



    return (
        <Carousel fade interval={null} indicators={false} controls={controls} className='carousel-div'>

            <Carousel.Item>
                <img className="d-block w-100" src={props.UserPhotos[0]} alt="Utilisateur" />
            </Carousel.Item>

            <Carousel.Item>
                <img className="d-block w-100" src={props.UserPhotos[1]} alt="Utilisateur" />
            </Carousel.Item>

            <Carousel.Item>
                <img className="d-block w-100" src={props.UserPhotos[2]} alt="Utilisateur" />
            </Carousel.Item>

        </Carousel>
    )
}


export default Carousel$;
